import skimage.io



class Classify():
    def __init__(self, model_path = './saved/train.h5') -> None:
        self.model = self.load_model(model_path)
        self.classes = ['valid' , 'invalid']


    def load_model(self, model_path):
        model = tf.keras.models.load_model(model_path)
        return model

    def decode_img_bytes(self, img_b64: str) -> tf.Tensor:
            imgdata = base64.b64decode(img_b64)
            img = skimage.io.imread(imgdata, plugin='imageio')
            
            
            return img

    def predict(self, base64_image):
        image = self.decode_img_bytes(base64_image)
        #Reshape to 244x244x3
        image = tf.image.resize(image, (224, 224))
        image = tf.keras.applications.mobilenet_v2.preprocess_input(image)
        image = image[np.newaxis, ...]
        pred = self.model.predict(image)
        pred = np.argmax(pred, axis=1)
        pred = self.classes[pred[0]]
        return pred

